import React from "react";
import axios from "axios";


let Todos =
class data{
    todos = [];

    assign (id){
        if(id<=3){
            this.todos[id].completed = true;
        }
    }

    initial(){
        console.log("skdyufiudy")
        axios.post("https://jsonplaceholder.typicode.com/todos")
                .then(response => {
                    response.map(todo =>{
                        const items = {
                            title: todo.title,
                            completed: todo.completed
                        }
                        this.todos.push(items);
                    })
                }
            )
    }

}
export default data;
